import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./components/Navbar";
import LandingPage from "./pages/LandingPage";
import LoginPage from "./pages/LoginPage";
import DashboardPage from "./pages/DashboardPage";
import MinisterPage from "./pages/MinisterPage";
import SettingsPage from "./pages/SettingsPage";
import DocsPage from "./pages/DocsPage";
// App.js (or wherever you render it)
import CloudDataServerModule from "./modules/CloudDataServerModule";




function App() {
   return (
    <div>
      {/* Force backend host so module does not call the frontend dev server */}
      <CloudDataServerModule apiBase="http://127.0.0.1:8000" />
    </div>
  );
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/dashboard" element={<DashboardPage />} />  {/* required */}
          <Route path="/settings" element={<SettingsPage />} />
          <Route path="/ministers/:id" element={<MinisterPage />} />
           <Route path="/docs" element={<DocsPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
